import { SET_VISIBILITY_FILTER } from "./actionsTypes";

export default function visibilityFilterReducer(state = 'SHOW_ALL', action) {
  switch (action.type) {
    case SET_VISIBILITY_FILTER:
      return action.filter;
    default:
      return state;
  }
}
